import React from 'react';
import UserList from '../components/UserList';
const HomePage = () => {
    return (
        <div className='container'>
            <div className='row'>
                <div className='col-sm'>
                    Test
                </div>
                <div className='col-sm'>
                    <UserList />
                </div>

            </div>
        </div>
    );
};

export default HomePage;
